package com.vin.trading_system.message.cache;

public class MessageField {

	private String key;
	private String value;
	
	
	public MessageField() {
		super();
	}


	public MessageField(String key, String value) {
		super();
		this.key = key;
		this.value = value;
	}


	public String getKey() {
		return key;
	}


	public String getValue() {
		return value;
	}
	
	
	
	
	
}
